import React, {Component, Fragment} from 'react';

class CheckoutBtn extends Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<button className="checkout-btn">
				Checkout
			</button>
		)
	}
}

export default CheckoutBtn;
